import logo from './logo.svg';
import './App.css';
// import imgs from './images/port11.png'
import React from 'react';


function Header() {
  return (
    <nav className="navbar navbar-expand-lg ">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">Navbar</a>
        <button className="navbar-toggler bg-white" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon text-white"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <a className="nav-link active text-white" aria-current="page" href="#">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link text-white" href="#">Features</a>
            </li>
            <li className="nav-item">
              <a className="nav-link text-white" href="#">Pricing</a>
            </li>
            <li className="nav-item">
              <a className="nav-link disabled text-white" aria-disabled="true">Disabled</a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}




function MyCard(props) {
  return (
    <div className="container">
      <div className="row row-cols-1 row-cols-md-2 row-cols-lg-4">
        <div className="col">
          <div className="card mb-3">
            <img src={props.img} className="card-img-top" alt="Card image" />
            <div className="card-body">
              <p className="card-text">{props.text}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}


function Introdiv()
{
  return (

    <div className="matter col-lg-6 col-md-12 col-sm-12">
    <h3>Hello, It's Me</h3>
    <h1>Mohan satya prasad</h1>
    <h3>And I'm a <span>Frontend Devoloper</span></h3>
    <p>Actually now i am practicing React js that'swhy i made this.</p>

    <div className="socialmedia">
        <a href="#" ><i class="fa-brands fa-facebook"></i></a>
        <a href="#" ><i class="fa-brands fa-instagram"></i></a>
        <a href="#" ><i class="fa-brands fa-linkedin"></i></a>
        <a href="#" ><i class="fa-brands fa-twitter"></i></a>
    </div>

    <a href="#" className="btn">View my Resume</a>
</div>
  )
}

function Imagediv()
{
  return (
    <div className="homeimg col-lg-6 col-md-12 col-sm-12">
    <div className="photodiv">
    </div>
    <img src="mypic.png" alt="msp"  className="myimg" />
 </div>
  )
}

function Body()
{
  return (
    <section className="home">
       <div className="container">
       <div className="row">
        <Introdiv/>
        <Imagediv/>
        </div>
        </div>
        MyCard<></>
    </section>


  )
}

function App() {
  return (
    <div className='App'>
      <Header/>
      <Body/>
    </div>
  );
}

export default App;
